const routes:Routes=[
  {
    path:'',
    redirectTo:'home',
    pathMatch:'full'
  }
  ,
  {
    path:'home',
    component:HomeComponent
  }


];

@NgModule({
  declarations: [
    HomeComponent
  ],

  imports: [
    CommonModule,
    RouterModule.forChild(routes),
    AngularMaterialModule
  ]
})
export class HomeModule { }
